import { Client } from 'ssh2';

interface SshConnectionOptions {
  host: string;
  username: string;
  password: string;
  port?: number;
}

export const sshConnect = (options: SshConnectionOptions, callback: (error?: Error) => void): void => {
  const conn = new Client();
  const { host, username, password, port = 22 } = options;

  conn.on('ready', () => {
    console.log('SSH connection established');
    callback();
  }).on('error', (err: Error) => {
    console.error('SSH connection error', err);
    callback(err);
  }).on('end', () => {
    console.log('SSH connection ended');
  });

  conn.connect({
    host,
    port,
    username,
    password,
  });
};
